import { Link } from 'react-router-dom';
import CarDetails from '../CarDetails';
import Blogitem from '../components/BlogItem/BlogItem';

function Home() {
    return (
        <div>
            {CarDetails.map((car) => {
                return (
                    <div>
                        <h2>{car.CarMake}</h2>
                        <Link to={`/blogdetail/${car.id}`}></Link>
                    </div>
                );
            })}
        </div>
    );

}

export default Home;
